import React from "react";

import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";

import CustomCard from "../components/CustomCard";
const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: "24px"
  },
  title: {
    flexGrow: 1,
    marginLeft: "24px"
  },
  test: {
    marginLeft: "24px",
    marginRight: "24px"
  },
  card: {
    backgroundColor: "red",
    margin: "24px",
    padding: theme.spacing(2)
  }
}));
function Develop() {
  const classes = useStyles();
  return (
    <Grid container>
      <Grid item xs={12}>
        <h1 className={classes.test}>This is Develop</h1>
      </Grid>
      <CustomCard
        xs={12}
        src="https://aw-blogs.s3.ap-northeast-2.amazonaws.com/1575508551594.png"
      ></CustomCard>
    </Grid>
  );
}

export default Develop;
